import "../styles/HomePage.css";

function HomePage() {
  return (
    <div className="home-container">
      <div className="effect-area">
        <h1>Welcome to <b><i className="gradient-text">#GT Bharat</i></b> Cyber Vigiliance Centre</h1>
      </div>
    </div>
  );
}

export default HomePage;
